import './App.css';
import Layout from './Restaurant/Layout/Layout';
// import AccordianComp from './Material UI/AccordianComp';
// import CardComp from './Material UI/CardComp';
// import ListComp from './Material UI/ListComp';
 //import Header from './Project/Header';
// import CardsComp from './Project/CardsComp';
import {BrowserRouter,Routes,Route} from "react-router-dom"
import About from './Restaurant/Layout/Pages/About';
import Home from './Restaurant/Layout/Pages/Home';
import Contact from './Restaurant/Layout/Pages/Contact';
import Menu from './Restaurant/Layout/Pages/Menu';
import Pagenotfound from './Restaurant/Layout/Pages/Pagenotfound';
import Header from './Restaurant/Layout/Header';


function App() {
  return (
    <div className="App">
  {/* <Header/>
  <CardsComp/> */}
  {/* <Header />*/}
  <BrowserRouter>
  <Routes>
    <Route path='/' element={<Home />} />
    <Route path='/about' element={<About />} />
    <Route path='/contact' element={<Contact />} />
    <Route path='/menu' element={<Menu />} />
    <Route path='*' element={<Pagenotfound />} />
  </Routes>
  </BrowserRouter> 

    </div>
  );
}

export default App;
